        console.log(e.target.value);

    }

    return(
        <>
            <h1>Login</h1> <br/>
            <form onSubmit={formSubmitted}>
                <input type="text" placeholder="Enter User Id" onChange={userInput}/> <br/>  <br/>
                <input type="text" placeholder="Enter Password"/> <br/> <br/>
                <button type="submit">Submit</button>

            </form>
        </>
    )
}

